        </CWidgetIcon>
      </CCol>

      <CCol xs="12" sm="6" lg="3">
        <CWidgetIcon text="Total Paid Orders" header="5" color="success">
          <CIcon width={24} name="cil-credit-card" />
        </CWidgetIcon>
      </CCol>

      <CCol xs="12" sm="6" lg="3">
        <CWidgetIcon text="Total Users" header="190" color="success">
          <CIcon width={24} name="cil-check" />
