      <CCol xs="12" sm="6" lg="3">
        <CWidgetIcon text="Total Stores" header="12" color="danger">
          <CIcon width={24} name="cil-ban" />
        </CWidgetIcon>
      </CCol>

      <CCol xs="12" sm="6" lg="3">
        <CWidgetIcon text="Stock" header="2043" color="primary">
          <CIcon width={24} name="cil-user" />
